#define STDOUT 0xd0580000

.section .text
.global _start
_start:

la s1, board
li s2, 64 #size
li s3, 1 #for boolean check


jal solveBoard
j exit

solveBoard:
    addi sp, sp, -20
    sw s4, 16(sp)
    sw a3, 12(sp)
    sw a2, 8(sp)
    sw a1, 4(sp)
    sw ra, 0(sp)
    jal saveTempRegisters

    li a1, 0
    mul t0, s2, s2 
    
    outer:
        bge a1, t0, solved
        li a2, 0
        add t3, s1, a1
        inner:
            bge a2, s2, innerEnd
            add s4, t3, a2
            lb t4, 0(s4)
            beqz t4, anotherLoop
            addi a2, a2, 1
            j inner
            anotherLoop:
                li a3, 1
                looop:
                    bgt a3, s2, reject
                    jal isSafe
                    bne a0, s3, nope
                    sb a3, 0(s4)
                    jal solveBoard
                    beq a0, s3, solved
                    sb zero, 0(s4)
                    nope:
                        addi a3, a3, 1
                        j looop
                reject:
                    jal restoreTempRegisters
                    lw ra, 0(sp)
                    lw a1, 4(sp)
                    lw a2, 8(sp)
                    lw a3, 12(sp)
                    lw s4, 16(sp)
                    addi sp, sp, 20
                    li a0, 0
                    jr ra
        innerEnd:
            add a1, a1, s2 
            j outer
    solved:
        jal restoreTempRegisters
        lw ra, 0(sp)
        lw a1, 4(sp)
        lw a2, 8(sp)
        lw a3, 12(sp)
        lw s4, 16(sp)
        addi sp, sp, 20
        li a0, 1
        jr ra

isSafe:
    addi sp, sp, -8
    sw s4, 4(sp)
    sw ra, 0(sp)
    jal saveTempRegisters

    addi t0, zero, 0
    mul t1, s2, s2
    
    colCheck:
        bge t0, t1, endColCheck
        add t2, t0, a2 # t2 = row + col
        add t3, t2, s1 #address = base adrees + (t2)
        lb t4, 0(t3)
        beq t4, a3, notSafe #check with num
        add t0, t0, s2 #next row the value 4 for refers to SIZE
        j rowCheck
    endColCheck:

    addi t0, zero, 0
    
    rowCheck:
        bge t0, s2, endRowCheck
        add t2, t0, a1 # t2 = row + col
        add t3, t2, s1 #address = base adrees + (t2)
        lb t4, 0(t3)
        beq t4, a3, notSafe #check with num
        addi t0, t0, 1 #next col
        j colCheck
    endRowCheck:

	
    li t0, 8 #the value 2 refers to (squareRoot(SIZE))
    div t1, a1, s2
    rem t1, t1, t0
    mul t1, t1, s2
    sub t1, a1, t1
    rem t2, a2, t0
    sub t2, a2, t2

    addi t3, t1, 448 #outerloop check the value 4 refers to (SIZE * (sqrRoot(SIZE) - 1)
    addi t4, t2, 1 #innerloop check
    
    outerLoop:
        bgt t1, t3, safe
        add t5, s1, t1
        rem t2, a2, t0
        sub t2, a2, t2
            innerLoop:
                bgt t2, t4, endInnerLoop
                add s4, t5, t2
                lb t6, 0(s4)
                beq t6, a3, notSafe
                addi t2, t2, 1             
                j innerLoop
        endInnerLoop:
        add t1, t1, s2 
        j outerLoop
        
    notSafe:
        li a0, 0
        jal restoreTempRegisters
        lw ra, 0(sp)
        lw s4, 4(sp)
        addi sp, sp, 8
        jr ra
    safe:
        li a0, 1
        jal restoreTempRegisters
        lw ra, 0(sp)
        lw s4, 4(sp)
        addi sp, sp, 8
        jr ra

saveTempRegisters:
    addi sp, sp, -28
    sw t6, 24(sp)
    sw t5, 20(sp)
    sw t4, 16(sp)
    sw t3, 12(sp)
    sw t2, 8(sp)
    sw t1, 4(sp)
    sw t0, 0(sp)    
    jr ra

restoreTempRegisters:
    lw t0, 0(sp)
    lw t1, 4(sp)
    lw t2, 8(sp)
    lw t3, 12(sp)
    lw t4, 16(sp)
    lw t5, 20(sp)
    lw t6, 24(sp)
    addi sp, sp, 28
    jr ra

exit:
	  addi t0, zero, 0
	  mul t1, s2, s2
	  
	  loop:
	  	beq t0, t1, exit2
	  	add t2, s1, t0
	  	lb t3, 0(t2)
	  	addi t0, t0, 1
	  	j loop
	  exit2:
	  
	  
	    
    # Finish section
    
_finish:
    li x3, 0xd0580000
    addi x5, x0, 0xff
    sb x5, 0(x3)
    beq x0, x0, _finish
.rept 100
    nop
.endr

